import Container from 'react-bootstrap/Container'
import Navbar from 'react-bootstrap/Navbar'
import './Header.css'
const Header = () => {
    return (
        <Container className='appHeader m-0 mw-100 d-flex align-items-center'>
            <p className='w-25 p-0'>Hola Sebastian</p>
            <Navbar className='p-0 d-flex justify-content-end w-75'>
                <Navbar.Brand href="!#">CERRAR SESION</Navbar.Brand>
            </Navbar>
        </Container>
    );
}
 
export default Header
